    false,nt"url": null,nt"notes": "This dataset contains property tax rates
    for all levy authorities within the State of Iowa by fiscal year.  Property tax
    rates are the dollars collected per $1,000 in a property's taxable value. The state
    fiscal year runs from July 1 to the following June 30 and is numbered for the calendar
    year in which it ends.  Rates for a fiscal year are based on the taxable property
    valuations for the preceding calendar year (e.g. FY 2014 rates are based on 2012
    taxable property valuations).",nt"license_title": "License Not Specified",nt"extras":
